import React from 'react';
import homeImage from './assets/home/homeimage.png'; 

export default function Home() {
  return (
    <div className="flex flex-col justify-center items-center text-center space-y-4">
      <h1 className="text-xl text-green-400 font-medium">Welcome to Our Website</h1>
      <p>This is the home page. We hope you find what you're looking for!</p>
      <div className="w-full max-w-4xl">
        <img src={homeImage} alt="Home Visual" className="max-w-full h-auto" />
      </div>
    </div>
  );
}
